const Listings = () => {
  const [listings, setListings] = useState([]);

  useEffect(() => {
    //console.log('hello world');
  //  alert('safasf');
    // Fetch data from the API and set it in the listings state
    // Replace 'API_URL' with the actual API endpoint
   const {data} = axios.get(`${host}/alllistings`)
    .then((response) => response.json())
        .then((data) => {
          console.log(data);
          // Process the fetched data
          setListings(data.data);
        })
        .catch((error) => {
          // Handle errors
          console.error(error);
        });
   //   alert(data);
